import React, { Component } from 'react';

class Steps extends Component {

    render() {
        return (
            <div className="row form-steps pt-4">
                <div className={"col-lg-3 col-3 " + (this.props.step > 0 ? 'active' : '')}>
                <i className="far fa-address-book" aria-hidden="true"></i><br/>Contact</div>
                <div className={"col-lg-3 col-3 " + (this.props.step > 1 ? 'active' : '')}>
                    <i className="fa fa-unlock-alt" aria-hidden="true"></i><br/>Password</div>
                <div className={"col-lg-3 col-3 " + (this.props.step > 2 ? 'active' : '')}>
                    <i className="fa fa-map-marker" aria-hidden="true"></i><br/>Name</div>
                <div className={"col-lg-3 col-3 " + (this.props.step > 3 ? 'active' : '')}>
                    <i className="fa fa-map-marker" aria-hidden="true"></i><br/>Postcode</div>
            </div>
        )
    }
}

export default Steps;
